    function swimmerSearch() {
        var input, filter, table, swimmersElems, name, i, surname;
        input = document.getElementById("search-input");
        filter = input.value.toUpperCase();
        table = document.getElementById("swimmers-table");
        swimmersElems = table.getElementsByTagName("tr");

        for (i = 0; i < swimmersElems.length; i++) {
            name = swimmersElems[i].getElementsByTagName("td")[1];
            surname = swimmersElems[i].getElementsByTagName("td")[2];
            if (name && surname) {
                name = name.innerHTML.toUpperCase() + " " + surname.innerHTML.toUpperCase();
                if (name.indexOf(filter) > -1) {
                    swimmersElems[i].style.display = "";
                } else {
                    swimmersElems[i].style.display = "none";
                }
            }
        }
    }
